        [head=2]                 Hey you! Smartypants! [/head]


        [italic]I'm gonna be out of a shift for a while, so make sure you maintain this news room in [bolditalic]tip-top shape![/bolditalic] Otherwise, it's gonna degrade our status as a news network! Who knows... maybe the Syndicate will take over the TV channels! You wouldn't want that, would you? (unless you are with the syndciate yourself...)

        Do your best to keep this news room in it's best quality! Maintain the greenscreen, fix any broken floorboards or grilles, replace the lights, anything to keep this room pristine![/italic]


