        [head=2]+----------------------------------------------+

        |  How to create your own DAW!  |

        +----------------------------------------------+[/head]
            [italic]Written by: Barthel Brindle, Scientist[/italic]

        Hello, aspiring musician! We here at NT [italic]love[/italic] the work you do for the station; it's simply beautiful to the ears! So, we have provided you your own DAW board to build up your workstation!

          [head=3]Checklist:[/head]

         \[  ] - 1x mixed instrument crate (ask [color=brown]cargo[/color], or find the needed instruments yourself, if you can!)
         \[  ] - 1x piece of [color=lightblue]glass[/color]
         \[  ] - 1x piece of [color=green]LV wire[/color]
         \[  ]  - a toolbox, with a [color=blue]screwdriver[/color] and a [color=gray]wrench[/color] (optional, you may also ask a nearby [color=orange]engineer[/color] for help!)

           [head=3]Steps:[/head]

           1: Setup a machine frame (we have made one for you!)
           2: Gather these items:
           3: Put all the items you have into the machine frame
           4: Grab a screwdriver and screw it tight
           5: Enjoy your brand new [bold]DAW![/bold]
